void MyMaterial_road_1(GLenum mode,GLfloat *f,GLfloat alpha)
{
 GLfloat d[4];
 d[0]=f[0];
 d[1]=f[1];
 d[2]=f[2];
 d[3]=alpha;
 glMaterialfv (GL_FRONT_AND_BACK,mode,d);
}
/*
 *  SelectMaterial uses OpenGL commands to define facet colors.
 *
 *  Returns:
 *    Nothing
 */

void SelectMaterial_road_1(int i)
{
  //
  // Define the reflective properties of the 3D Object faces.
  //
  glEnd();
  GLfloat alpha=materials_road_1[i].alpha;
  MyMaterial_road_1 (GL_AMBIENT, materials_road_1[i].ambient,alpha);
  MyMaterial_road_1 (GL_DIFFUSE, materials_road_1[i].diffuse,alpha);
  MyMaterial_road_1 (GL_SPECULAR, materials_road_1[i].specular,alpha);
  MyMaterial_road_1 (GL_EMISSION, materials_road_1[i].emission,alpha);
  glMaterialf (GL_FRONT_AND_BACK,GL_SHININESS,materials_road_1[i].phExp);
  glBegin(GL_TRIANGLES);

}

